import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';

export default function App() {

  function onPress() {
    console.log('Teste');
  }

  const staticImage = [
    require('src/img/img-1.jpg'),
    require('src/img/img-2.jpg'),
    require('src/img/img-3.jpg'),
    require('src/img/img-4.jpg')
  ];

  return (
    <View style={styles.container}>

      <View style={styles.containerTitle}>
        <Text style={styles.containerTitle.title}>Meu treino</Text>
      </View>

      <View style={styles.buttonsDifficulty}>
        <TouchableOpacity style={styles.buttonsDifficulty.button} onPress={onPress}>
          <Text style={styles.buttonsDifficulty.button.text}>Fácil</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.buttonsDifficulty.button} onPress={onPress}>
          <Text style={styles.buttonsDifficulty.button.text}>Médio</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.buttonsDifficulty.button} onPress={onPress}>
          <Text style={styles.buttonsDifficulty.button.text}>Difícil</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.containerImages}>
        
        <Image
          source={staticImage[0]}
        />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: { // Tela do celular
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    paddingVertical: '5px',
    paddingHorizontal: '25px'
  },

  containerTitle: { // Title 
    width: '100%',

    title: {
      fontSize: '18px',
      fontWeight: 'bolder'
    }
  },

  buttonsDifficulty: { // Botões de dificuldades
    width: '100%',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',

    button: {
      width: '50px',
      height: '25px',
      borderWidth: '1.7px',
      borderColor: 'rgba(0, 0, 255, 0.4)',
      backgroundColor: 'rgba(0, 0, 255, 0.07)',
      textAlign: 'center',
      borderRadius: '4px',

      text: {
        fontSize: '15px',
      }
    }
  },

  containerImages: {
    width: '100%',
    height: '50%',
    marginTop: '20px',
    borderWidth: '1.9px',
    borderRadius: '15px',
  }



});
